import React from "react";
import { Calendario } from "./style";


function OrganizarSemana({ diaSemana }: { diaSemana: any; }){
  let domingo=[];
  for (let i = 0; i < diaSemana.length; i++) {
    let element = diaSemana[i];
    domingo[i] = <li>{element}</li>
  }
  return domingo;
}

function Card(dias: any) {
  var domingo;
  domingo = OrganizarSemana({ diaSemana: dias.dias.domingo });

  console.log(domingo);

  return (
    <>
      <Calendario>
        {domingo}
      </Calendario>
    </>
  );


}

export default Card;
